import React from "react";
import ReactDelayRender from "react-delay-render";
import FadeIn from "react-fade-in";

import "./Projects.css";

const Projects = () => {
  return (
    <FadeIn>
      <div>
        <p className="about__paragraph">
          So far I am familair with HTML5, Native Javascript, CSS (SASS+LESS),
          Bootstrap, Node.js, Git - I am constantly trying to expand my
          understanding of technologies and incorporate them in my work.
          Currently diving into frameworks with React.js + Redux. And looking
          for potential Junior positions to expand my skillset and make it a
          career.
        </p>
      </div>
    </FadeIn>
  );
};

export default ReactDelayRender({ delay: 401 })(Projects);
